import React from 'react'
import './HomeFooter.css';

export default function HomeFooter() {
    return (
        <>
            <footer bg="dark" data-bs-theme="dark" footer>
                <center>
                    <div>
                        <span className='text-white'>2024 &copy; Kavindu Bimsara.</span>
                    </div>
                </center>
            </footer>
        </>
    )
}
